import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Building from "./views/building/buildingView.js";
import './App.css';


function App() {
  return (
    <BrowserRouter>

      <Router>
        <Route exact path="/get_Buildings" component={Building} />
      </Router>
      </BrowserRouter>

  );
}

export default App;
